import { createRouter, createWebHistory } from 'vue-router'

//==> importacoes das paginas




const routes = [
  {
    path: '/',
    name: 'home',
    component: ()=> import("@/components/authComponents/home")
  },
  {
    path: '/login',
    name: 'login',
    component: ()=> import("@/views/pages/login/LoginView")
  },
  {
    path: '/register',
    name: 'register',
    component: ()=> import("@/views/pages/register/RegisterView")
  }
]

const router = createRouter({
  history: createWebHistory(process.env.BASE_URL),
  routes
})

export default router
